import React from "react"; 
import "./Product.css"

function Product({product}) {
    return <div className= "product.contatiner">
        <img
        src={`./thumbnails/${product.imageUrl}` } alt = {product.name}
        onError = {(e) => (e.target.src = "./no-image")}
        />
        <div>{product.name}</div>
        <div>${product.price}</div>
    </div>
}

export default Product;
